import React, { Component } from 'react';

//props: 
// key (id)
//  id
// home
//  away
//  date
//time
//  timezone
//  location
//  stadium    
//home img
//away img  
// add game ( function reference )

class EventTab extends Component {
    //in class eventTab
    render() { 
        return (
            <React.Fragment>
                <div>{console.log(this.props)}</div>
                    <div class="match-up flex-item-eventTab">
                        <div>
                            <img src={this.props.homeImg} class="home-img"/>
                            {this.props.home} 
                        </div>
                         <div>vs</div>  
                         <div>
                            <img src={this.props.awayImg} class="away-img"></img>
                        {this.props.away}

                         </div>


                    </div>
                    <div class="btn-container">
                        <button class='flex-item-eventTab'
                                        onClick={() => this.props.addGame(this.props.id)}
                        >Add game</button>
                    </div>


                    <div class="location flex-item-eventTab">
                        <div>
                        {this.props.stadium}
                        </div>
                        <div>
                         {this.props.location}

                        </div>
                    </div>

                    <div class="time flex-item-eventTab">
                        <div>
                        {this.props.date}
                        </div>
                        <div>
                        {this.props.time}
                        </div>  

                    </div>

            </React.Fragment>
        );
    }
}

export default EventTab;
